### YamlMime:QSharpType
uid: microsoft.quantum.core.rangeend
name: RangeEnd
type: function
namespace: Microsoft.Quantum.Core
summary: A megadott tartomány meghatározott záró értékét adja vissza, amely nem feltétlenül a sorrend utolsó eleme.
remarks: >-
  A Range kifejezés első eleme `start`, a második elem `start+step`, a harmadik elem pedig `start+step+step`, stb., amíg `end` át nem telik.


  Vegye figyelembe, hogy egy tartomány meghatározott záró értéke különbözhet a tartomány által meghatározott utolsó elemtől. például egy 0. tartományban. 2.. 5 az utolsó elem 4, a záró érték pedig 5.
syntax: 'function RangeEnd (range : Range) : Int'
input:
  content: '(range : Range)'
  types:
  - name: range
    isPrimitive: true
    uid: Range
output:
  content: Int
  types:
  - summary: A megadott tartomány megadott záró értéke.
    isPrimitive: true
    uid: Int
